      opacity: 0;
      position: absolute;
      z-index: -1;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      transition: all .3s;
      transition-timing-function: ease-in;
      background: rgba(240, 240, 240, 0.8)
