    .ld-square:after,
    .ld-pie:after,
    .ld-spinner:after {
      content: " ";
      display: block;
      width: 2em;
      height: 2em;
      box-sizing: border-box;
      transform-origin: 0 0;
      transform: translateZ(0) scale(0.5);
      backface-visibility: hidden
    }

    .ld-ring:after {
      border-radius: 50%;
      border: .3em solid currentColor;
